import products from "../products.json"

function ShoppingCart() {
    // console.log(products);
    return (
        <div>
            {products.cart.item.map((product) => (
                <div>
                    <p>{product.name}</p>
                    <p>Qtd.:{product.quantity}</p>
                    <p>{product.bestPriceFormated}</p>
                </div>
            ))}
        </div>
    )
}

export default ShoppingCart;
